post_content:
PolyLite es una familia de filamentos de impresión 3D fabricados con las mejores materias primas para ofrecer una calidad y fiabilidad excepcionales. PolyLite PLA es un material de alta calidad diseñado para brindar todas las facilidades de impresión.
<ul>
 	<li>Temperatura boquilla: 190˚C – 210˚C</li>
 	<li>Velocidad de Impresión: 40mm/s – 60mm/s</li>
 	<li>Temperatura de plataforma:25˚C – 60˚C</li>
 	<li>Superficie de impresión: Vidrio con goma, Cinta azul, BuilTak®</li>
 	<li>Ventilador de capa: Prendido</li>
</ul>
